import styled from "styled-components";

const Container = styled.div`
  display: flex;
  height: 552px;
  width: 100%;
  background-color: coral;
  justify-content: center;
  align-items: center;
`;

const AppAward = styled.div`
  background-color: #ed1eed;
  display: flex;
  width: 1040px;
  height: 412px;
  justify-content: center;
`;
const AwardImg = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: Lime;
  figure {
    margin: 0;
    line-height: 0;

    position: relative;
    figcaption {
      position: absolute;
      top: 280px;
      text-align: center;
      color: #c8c8c8;
      line-height: 1;
      left: 0;
      right: 0;
      /* bottom: 0; */
    }
    img {
      height: 338px;

      width: 400;
      z-index: 1000;
    }
  }
`;

const AwardDescription = styled.div``;
const Discription = styled.div``;
const Award = styled.div``;

function Section() {
  return (
    <Container>
      <AppAward>
        <AwardImg>
          <figure>
            <img src="./img/img-02-triple@3x.png" alt="" />
            <figcaption>2021년 12월 기준</figcaption>
          </figure>
        </AwardImg>
        <AwardDescription>
          <Discription>
            <ul>
              <li>
                <strong>700만 명</strong>
                <span>의 여행자</span>
              </li>
              <li>
                <strong>700만 명</strong>
                <span>의 여행자</span>
              </li>
              <li>
                <strong>700만 명</strong>
                <span>의 여행자</span>
              </li>
            </ul>
          </Discription>
          <Award></Award>
        </AwardDescription>
      </AppAward>
    </Container>
  );
}

export default Section;
